import React from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';

const Page = () => {
    return ( 
        <div>
            <p className="bg-success text-white text-center text-decoration-line-through mt-5 ms-5 me-5 mb-5">hello world</p>
            <p className="text-white ">My Application</p>
            <button className="btn btn-primary btn-lg text-start">Submit</button>
            <button className="btn btn-outline-secondary btn-md rounded border-1">Submit</button>
            <button className="btn btn-danger btn-sm">Submit</button>
        </div>
     );
}

export default Page;
